import React, { Component } from "react";
import {Grid,Box} from '@material-ui/core'
import './style.css';
function Window(){
    return( 
       <div className="window">
        <div className="formate">
           <button  containerStyle={{padding:10, height:45, overflow:'hidden', 
       borderRadius:50, backgroundColor: 'yellow'}}
       style={{fontSize: 20, color: 'orange'}} >
              Add Book  
            </button>
        </div>
        <div className="formate">
           <button  containerStyle={{padding:10, height:45, overflow:'hidden', 
       borderRadius:50, backgroundColor: 'yellow' , border:"green"}}
       style={{fontSize: 20, color: 'blue'}}>
           Edit Book
            </button>
        </div>
        <div className="formate">
           <button containerStyle={{borderRadius:50, backgroundColor: 'yellow' , border:"green"}}>
          List All Book
            </button>
        </div>   
       </div>


    );
}
export default Window;
